import React from 'react';
import ExpenseItem from './ExpenseItem';

const ExpensesList = props =>{
    
    {props.expenses.length === 0 ? ( <p>NO Expenses Found</p> ):( props.expenses.map((expense) => (
        <ExpenseItem 
        key={expense.id}
        title={expense.title} 
        amount={expense.amount} 
        date={expense.date} 
        />
        )))}

        return (
            <ul className="expenses-list">
{      props.expenses.map((expense) => (
        <ExpenseItem 
        key={expense.id}
        title={expense.title} 
        amount={expense.amount} 
        date={expense.date} 
        />
        ))}

            </ul>
        )
        

}
export default ExpensesList;
